form_header.before_load:
Form.selectResponseOptions = function(test_header_code, question_code, attribute = null, value = null) {
  return $(
    Form.
    getTestQuestionByCode(test_header_code, question_code).
    getField()
  ).
  children(
    !(attribute || value) ? 
      null : 
      `:has([${attribute}=${value}])`
    );
};

