  Form.selectResponseOptions("ot_p_pc", "ot_r").
    not(
      Form.selectResponseOptions("ot_p_pc", "ot_r", "output_code", "X")
    )[
      Form.getTestAnswerValueByCode("ot_p_pc", "ot_r", "X") ? "addClass" : "removeClass"
     ]("disabled");
} catch {}

